package test2;

public class Test {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i = 10 ; i <= 20; i++) {
			System.out.println(i);
		}
		
		System.out.println("out");
		for (int i = 30 ;i >= 20; i--) {
			System.out.println(i);
		}
		
		int x = 10;
		do {
			System.out.println("check if do while loop is working");
		}while(x > 20);

	}

}
